import React, { Component } from 'react';

const Button = (props) => {
	const season = (): string => {
		switch (props.period) {
			case 1:
				return '春';
				break;
			case 2:
				return '夏';
			case 3:
				return '秋';
			case 4:
				return '冬';
		}
	};

	return <button type="button">{`${props.year} ${season}`}</button>;
};

export default Button;
